  return (
    <div className='App'>
        <ClickCounter/>
        <HoverCenter/>

        <ClickCounterTwo/>
        <HoverCounterTwo/>
        
        {/* <User name = {(isLoggedIn) => "Seun Osinowo" : "Guest"} /> */}
        <User />
    </div>
  );
}

